shaders.vertex:
attribute vec4 aVertex;
attribute vec4 aTexCoord;
varying vec4 vTexCoord;

void main(void)
{
    vTexCoord = aTexCoord;
    gl_Position = aVertex;
}

shaders.fragment:
/// http://vulture-vs-crows.googlecode.com/svn-history/r2/trunk/VultureVSCrows/resources/shaders/shader.frag

#ifdef GL_ES
precision highp float;
#endif

varying vec4 vTexCoord;
uniform sampler2D uTexture;
uniform float uT;
uniform vec2 uResolution;
uniform vec2 uMouse;
uniform int uBlurPixelsPerSide; // 0, 8, 8
uniform float uSigma0; // 2, 10, 5
uniform float uR; // 0, 1, 0.07

vec2 mouse = uMouse / uResolution;

vec4 pseudogaussianblur(sampler2D img, vec2 coord) {
  vec2 size = vec2(1.0, 1.0) / uResolution;
  float r = uR / dot(mouse - coord, mouse - coord);
  if (r < 1.0) {
    float sigma = uSigma0 * (1.0 - r);
    float a = 2.0 / sigma;
    float b = exp(-0.5 / (sigma * sigma));
    vec3 incrementalGaussian = vec3(a, b, b*b);
    vec4 sum = texture2D(img, coord) * incrementalGaussian.x;
    float coefficientSum = incrementalGaussian.x;
    incrementalGaussian.xy *= incrementalGaussian.yz;
    for (int i = 0; i < uBlurPixelsPerSide; ++i) {
      vec2 offset = vec2(0.0, float(i+1) * size.y);
      sum += texture2D(img, coord - offset) * incrementalGaussian.x;
      sum += texture2D(img, coord + offset) * incrementalGaussian.x;
      coefficientSum += 2.0 * incrementalGaussian.x;
      incrementalGaussian.xy *= incrementalGaussian.yz;
    }
    for (int i = 0; i < uBlurPixelsPerSide; ++i) {
      vec2 offset = vec2(float(i+1) * size.x, 0.0);
      sum += texture2D(img, coord - offset) * incrementalGaussian.x;
      sum += texture2D(img, coord + offset) * incrementalGaussian.x;
      coefficientSum += 2.0 * incrementalGaussian.x;
      incrementalGaussian.xy *= incrementalGaussian.yz;
    }
    return sum / coefficientSum;
  }
  else {
    return texture2D(img, coord);
  }
}

void main(void)
{
    gl_FragColor = pseudogaussianblur(uTexture, vTexCoord.st);
}
